import datetime


def getSimpleString() -> str:
    """This is a simple string"""
    return "Hello World"


def getSimpleNumber() -> int:
    """This is a simple number"""
    return 42


def getSimpleList() -> list:
    """This is a simple list"""
    return [1, 2, 3]


def getRandomDate() -> datetime:
    """This is a random date"""
    return datetime.datetime.now()


def getSimpleDict() -> dict:
    """This is a simple dict"""
    return {"key": "value"}


def getSimpleTuple() -> tuple:
    """This is a simple tuple"""
    return (1, 2, 3)
